// @ts-nocheck
declare namespace java {
    namespace security {
        namespace acl {
            // @ts-ignore
            interface Permission {
                /**
                 * Returns true if the object passed matches the permission represented
                 * in this interface.
                 */
                // @ts-ignore
                 equals(another: java.lang.Object): boolean;
                /**
                 * Prints a string representation of this permission.
                 */
                // @ts-ignore
                 toString(): string;
            }
        }
    }
}
